    email: "congue@acfermentumvel.ca"
  },
  {
    name: "Lawrence Wheeler",
    email: "ac.libero@Duisac.org"
  },
  {
    name: "Preston Walker",
    email: "egestas.rhoncus@eudui.co.uk"
  },
  {
    name: "Simon Brewer",
    email: "nunc.sed@Fuscediamnunc.co.uk"
  }
];


function App() {
  return (
    <div className="App">
      <div>
        <input
          type="text"
          value={this.state.searchString}
          ref="search"
          onChange={this.handleChange}
          placeholder="Country"
        />
        <ul>
          {_users.map(l => {
            return (
              <li>
                {l.name} <a href="#">{l.email}</a>
              </li>
            );
          })}
        </ul>

      </div>
       <h1 className="header">External API</h1>
       <GetOnlinePosts/>
     </div>
  );
}

export default App;
